Well, here's a deck that I never thought would become good: Melffy.

&nbsp;

This here is a Tribrigade Melffy deck that uses the latter's newest piece of support, an Xyz Monster called Excited Melffys. Because of that card's name, I decided to name this deck "So Excited!!", after a joke from Kevin Hart's comedy tour "Irresponsible Tour."

&nbsp;

The "So Excited!" joke: <a>https://www.youtube.com/watch?v=TUJVkj2FK00&amp;t=49s</a>

&nbsp;

Due to this deck's abundance of hand traps, Lightning Storm, and Dark Ruler No More, you absolutely HAVE to go second. So Excited's strategy is to use whatever cards you have to punish your opponent's plays, then summon a Rank 2 Xyz--most likely Excited Melffys--to battle with, and then use that to summon Negalogia AA-Zeus after it battles. Also, the Tribrigade Monsters and 3 copies of Tenki are there as play extenders.

