This build has a focus on solely using one of the two variations of the one card combo, or, if you have 2 prank-kids in your hand, 2 card combos that only summon 4 times in a turn. With the room saved from not needing polymerization, ultra polymerization, or cards that search them, it is able to play a plethora of hand traps, making it much stronger at going 2nd compared to other builds, while not sacraficing much strength in going first.

&nbsp;

This build is focussed more on TCG rules, even though it has crossout designator. Parallel exceed cannot chain block using OCG rules like it can here in the TCG:/

&nbsp;

Either way, this is a super rewarding deck to become familiar with!
